/* Procedure structure for procedure `sp_addNewLetter` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_addNewLetter` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_addNewLetter`(
    IN _letterId VARCHAR (255),
    IN _userId VARCHAR(255),
    IN _letterTitle VARCHAR(255),
    IN _letterType VARCHAR(255),
    IN _letterDescription VARCHAR(255),
    IN _letterTags VARCHAR(255),
    IN _letterTo VARCHAR(255),
    IN _letterFrom VARCHAR(255))
BEGIN
	INSERT INTO tbl_letters (letterId, userId, letterTitle, letterType, letterDescription, letterTags, letterTo, letterFrom)
	VALUES (_letterId, _userId, _letterTitle, _letterType, _letterDescription, _letterTags, _letterTo, _letterFrom);
    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_addNewLetterPage` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_addNewLetterPage` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_addNewLetterPage`(IN _letterId VARCHAR(255), IN _pageNumber VARCHAR(255), IN _pageImage LONGBLOB)
BEGIN
	INSERT INTO tbl_pages (letterId, pageNumber, pageImage)
	VALUES (_letterId, _pageNumber, _pageImage);
    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_addNewUser` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_addNewUser` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_addNewUser`(
    IN _userPhoto LONGBLOB,
    IN _userId VARCHAR(255),
    IN _userFirstname VARCHAR(255),
    IN _userLastname VARCHAR(255),
    IN _userGender VARCHAR(10),
    IN _userContact VARCHAR(255),
    IN _roleId VARCHAR(255),
    IN _username VARCHAR(255),
    IN _userPassword VARCHAR(255),
    IN _userActive VARCHAR(255)
)
BEGIN
    INSERT INTO tbl_users (
        userPhoto,
        userId,
        userFirstname,
        userLastname,
        userGender,
        userContact,
        roleId,
        username,
        userPassword,
        userActive
    )
    VALUES (
        _userPhoto,
        _userId,
        _userFirstname,
        _userLastname,
        _userGender,
        _userContact,
        _roleId,
        _username,
        HEX(AES_ENCRYPT(_userPassword, 'agrecords2023')),
        _userActive
    );
END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_addUserPermission` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_addUserPermission` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_addUserPermission`(IN uid VARCHAR(100), IN pid VARCHAR(100))
BEGIN
	INSERT INTO tbl_user_permissions (userId, permissionId)
	VALUES (uid, pid);
    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_change_password` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_change_password` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_change_password`(IN uid VARCHAR(100), IN pw VARCHAR(50))
BEGIN
	UPDATE tbl_users
	SET userPassword = HEX(AES_ENCRYPT(pw, 'agrecords2023'))
	WHERE userId = uid;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_checkUserActive` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_checkUserActive` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_checkUserActive`(IN un VARCHAR(50))
BEGIN
	SELECT COUNT(*) FROM tbl_users WHERE username = un AND userActive = 'Active';
    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_findUserIdByFullName` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_findUserIdByFullName` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_findUserIdByFullName`(IN _fullName VARCHAR(255))
BEGIN
    SELECT userId
    FROM tbl_users
    WHERE CONCAT(userFirstname, ' ', userLastname) = _fullName;
END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_getUserById` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_getUserById` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_getUserById`(IN uid VARCHAR(100))
BEGIN
	SELECT * FROM tbl_users WHERE userId = uid;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_login` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_login` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_login`(IN un VARCHAR(100), IN pass VARCHAR(100))
BEGIN
	SELECT U.userPhoto, R.roleName AS userRole, U.username, U.userFirstname, U.userLastname, AES_DECRYPT(UNHEX(U.userPassword), 'agrecords2023') AS userPassword
	FROM tbl_users U
	INNER JOIN tbl_roles R ON U.roleId = R.roleId
	WHERE U.username = un AND U.userPassword = HEX(AES_ENCRYPT(pass, 'agrecords2023'));
END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_selectMaxLetterId` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_selectMaxLetterId` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_selectMaxLetterId`()
BEGIN
	SELECT MAX(letterId) FROM tbl_letters;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_selectMaxUserId` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_selectMaxUserId` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_selectMaxUserId`()
BEGIN
	SELECT MAX(userId) FROM tbl_users;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_updateLogin` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_updateLogin` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_updateLogin`(IN un VARCHAR(50))
BEGIN
	UPDATE tbl_login SET userIn = 1 WHERE username = un;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_updateLogout` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_updateLogout` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_updateLogout`()
BEGIN
	UPDATE tbl_login SET userIn = 0;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_updateUser` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_updateUser` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_updateUser`(
    IN _userId VARCHAR(255),
    IN _userPhoto LONGBLOB,
    IN _userFirstname VARCHAR(255),
    IN _userLastname VARCHAR(255),
    IN _userGender VARCHAR(255),
    IN _userContact VARCHAR(255),
    IN _roleId VARCHAR(255),
    IN _userActive VARCHAR(255)
)
BEGIN
    UPDATE tbl_users
    SET 
        userPhoto = _userPhoto,
        userFirstname = _userFirstname,
        userLastname = _userLastname,
        userGender = _userGender,
        userContact = _userContact,
        roleId = _roleId,
        userActive = _userActive
    WHERE userId = _userId;
END */$$
DELIMITER ;

